import React, { Component } from 'react'
import Chart from 'react-apexcharts'
import axios from 'axios'

export default class body extends Component {
    constructor(props) {
        super(props)

        this.state = {
            series: [{
                data: [

                ]
                }],
                options: {
                    chart: {
                      type: 'candlestick',
                      height: 350
                    },
                    title: {
                      text: 'CandleStick Chart',
                      align: 'left'
                    },
                    xaxis: {
                      type: 'datetime'
                    },
                    yaxis: {
                      tooltip: {
                        enabled: true
                      }
                    }
                  },
            }
        }

    componentDidMount(){
        axios.get("https://www.moneycontrol.com/mc/widget/basicchart/get_chart_value?classic=true&sc_did=IOC&dur=max")
        .then((result)=>{
            console.log(result);
        })
    }

    render() {
        return (
            <Chart options={this.state.options} series={this.state.series} type="candlestick" width={500} height={320} />
        )
    }
}
